import './App.css';
import Home from './Home';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom'

function App() {
  return (
    <div className="App">
      {/* <Home /> */}
      <Router>
        <Route>
          <Routes exact path="/" />
        </Route>
      </Router>
    </div>
  );
}

export default App;
